CREATE DEFINER=`root`@`localhost` PROCEDURE `GetContentMetrics`(Metric_Type varchar(10) )
BEGIN
IF Metric_Type = 'TOP5'
THEN
select Movie_Title, Movie_Rating from Movies
where MONTH(`Movie_Release_Date`) = MONTH(CURDATE()) 
ORDER BY Movie_Rating DESC LIMIT 5; 
ELSEIF Metric_Type = 'TOPGROSS'
THEN
select A.Movie_Title, sum(A.Trans_Amount) from 
(select * from Booking B, Shows S, Movies M 
where (B.FK_Show_ID=S.Show_ID and S.FK_Movie_ID=M.Movie_ID) ) A group by A.Movie_ID ORDER BY 2 DESC;
ELSE
BEGIN
END;
END IF;
END ;;
