CREATE DEFINER=`root`@`localhost` PROCEDURE `GetCustomerMetrics`(Metric_Type varchar(20) )
BEGIN
IF Metric_Type = 'MONTHLYSPEND'
THEN
SELECT AVG(A.Customer_Revenue) AS Avg_Customer_Revenue, A.booking_month As Month from  
(SELECT Customer_ID, SUM(Trans_Amount) AS Customer_Revenue, MONTH(Booking_Created_At) AS booking_month
FROM Booking B, Customer C
WHERE C.Customer_ID = B.Booking_ID
GROUP BY Customer_ID, booking_month) A GROUP BY A.booking_month
ORDER BY A.booking_month DESC;
ELSEIF Metric_Type = 'MONTHLYTICKETS'
THEN
SELECT AVG(A.Avg_TicketsBooked) AS Avg_Tickets, A.Month_Booked As Month from 
(SELECT Customer_ID, SUM(Seats_Booked) AS Avg_TicketsBooked , MONTH(Booking_Created_At) AS Month_Booked
FROM Booking B, Customer C
WHERE C.Customer_ID = B.Booking_ID
GROUP BY Customer_ID, Month_Booked) A GROUP BY A.Month_Booked
ORDER BY A.Month_Booked DESC;
ELSE
BEGIN
END;
END IF;
END ;;
